feature/id/346135/description/Beginnings_of_Bionic'),(109,'','',67,NULL,0,0,0,'2012-11-08 18:01:02',NULL,'{\"width\":445,\"height\":560}',0,''),(110,'Comic Books and Stuff..., WHAT IF….. the Star Wars and Marvel universe...','WHAT IF….. the Star Wars and Marvel universe crossed over?',68,NULL,1,0,0,'2012-11-08 18:06:41',NULL,NULL,0,'http://theamazingchief.tumblr.com/post/34659125851/what-if-the-star-wars-and-marvel-universe'),(111,'','',68,NULL,0,0,0,'2012-11-08 18:07:05',NULL,'{\"width\":500,\"height\":428}',0,''),(112,'','<p style=\"text-align: center;\"><iframe height=\"391px\" src=\"http://socialcam.com/videos/PXhIjzxc/embed?utm_campaign=web&amp;utm_source=embed\" width=\"520px\"></iframe></p>',69,NULL,1,0,0,'2012-11-08 19:19:51',NULL,NULL,1,''),(113,'','',69,NULL,0,0,0,'2012-11-08 19:20:56',NULL,'{\"width\":600,\"height\":450}',0,''),(114,'Feng Shui Health Environment','',48,NULL,0,0,0,'2012-11-12 08:46:46',NULL,'{\"width\":289,\"height\":415}',0,''),(116,'','<p>Feng shui or Fung shui, is a Chinese system of geomancy believed to use the laws of both Heaven (Chinese astronomy) and Earth to help one improve life by receiving positive qi. The original designation for the discipline is Kan Yu (simplified Chinese: 堪舆; traditional Chinese: 堪輿; pinyin: kāny&uacute;; literally: Tao of heaven and earth).</p>\n<p><br>The term feng shui literally translates as \"wind-water\" in English. This is a cultural shorthand taken from the passage of the now-lost Classic of Burial recorded in Guo Pu\'s commentary: Qi rides the wind and scatters, but is retained when encountering water.</p>\n<p><br>Historically, feng shui was widely used to orient buildings&mdash;often spiritually significant structures such as tombs, but also dwellings and other structures&mdash;in an auspicious manner. Depending on the particular style of feng shui being used, an auspicious site could be determined by reference to local features such as bodies of water, stars, or a compass. Feng shui was suppressed in China during the cultural revolution in the 1960s, but since then has increased in popularity.</p>\n<p><br>Modern reactions to feng shui are mixed. The Skeptic Encyclopedia of Pseudoscience states that some principles of feng shui are \"quite rational\", while noting that \"folk remedies and superstitions... [have been] incorporated into feng shui\'s eclectic mix\".</p>',48,NULL,1,0,0,'2012-11-12 09:07:52',NULL,NULL,1,''),(117,'','',32,NULL,0,0,0,'2012-11-27 09:28:08',24,'{\"width\":\"256\",\"height\":\"192\"}',0,''),(118,'','<div>\n<p style=\"text-align: center;\">The jackpot for Wednesday\'s Powerball jackpot has hit a record $550 million.</p>\n</div>\n<p style=\"text-align: center;\">NEW YORK (CNNMoney) -- Wednesday\'s Powerball drawing could be one for the history books, with the jackpot rising to a record $550 million.</p>\n<p style=\"text-align: center;\">The prize for last Saturday\'s Powerball was $325 million -- the fourth-largest in the game\'s history. For the 15th consecutive time, no players matched the winning numbers, which were 22, 32, 37, 44, 50 and Powerball 34.</p>',64,NULL,2,0,0,'2012-11-28 19:57:38',NULL,NULL,1,''),(119,'Fiend suspected of shoving straphanger in front of oncoming train charged with murder, but claims \'he attacked me first. ... He grabbed me\' - NY Daily News','The suspected subway psycho matter-of-factly confessed to shoving a straphanger in front of an oncoming train — and then standing on the platform to watch the man die, sources said.',70,NULL,0,0,0,'2012-12-06 08:51:24',NULL,NULL,0,'http://www.nydailynews.com/new-york/suspect-confe